import React, { Component } from 'react'
import { BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Home from '../component/home/Home';
import WhatchingVideo from '../component/whatching/WhatchingVideo'
export default class DieuHuongUrl extends Component {
    render() {
        return (
            <div>
                 <Route exact path="/">
                    
                </Route>
                <Route path="">
                    
                </Route>
                <Switch>
          <Route path="/">
          <WhatchingVideo />
          </Route>
          <Route path="/whatchingVideo">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
            </div>
           
        )
    }
}
